    <ol>
      <li parentName="ol">{`The applications settings can be accessed via the `}<strong parentName="li">{`“Settings”`}</strong>{` menu on the bottom navigation of the application.`}</li>
      <li parentName="ol">{`The settings menu provides certain options to increase the application’s security and offers options to exercise control over your biometric data.`}</li>
    </ol>
    <h3 {...{
      "id": "manage-confidence-level"
    }}>{`Manage confidence level`}</h3>
    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M6.3 5.69a.942.942 0 0 1-.28-.7c0-.28.09-.52.28-.7.19-.18.42-.28.7-.28.28 0 .52.09.7.28.18.19.28.42.28.7 0 .28-.09.52-.28.7a1 1 0 0 1-.7.3c-.28 0-.52-.11-.7-.3zM8 7.99c-.02-.25-.11-.48-.31-.69-.2-.19-.42-.3-.69-.31H6c-.27.02-.48.13-.69.31-.2.2-.3.44-.31.69h1v3c.02.27.11.5.31.69.2.2.42.31.69.31h1c.27 0 .48-.11.69-.31.2-.19.3-.42.31-.69H8V7.98v.01zM7 2.3c-3.14 0-5.7 2.54-5.7 5.68 0 3.14 2.56 5.7 5.7 5.7s5.7-2.55 5.7-5.7c0-3.15-2.56-5.69-5.7-5.69v.01zM7 .98c3.86 0 7 3.14 7 7s-3.14 7-7 7-7-3.12-7-7 3.14-7 7-7z"
              }}></path></svg></span>{`note`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Note: Confidence level can be modified only for Voice and Face authentication options.`}</p></div></div>
    <ol>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`Manage confidence level`}</strong>{` option on the Settings menu.`}</li>
      <li parentName="ol">{`You will be displayed with your `}<strong parentName="li">{`enrolled biometric options`}</strong>{`. By default voice authentication will have the confidence level set at `}<strong parentName="li">{`87%`}</strong>{` and face authentication will have the confidence level set at `}<strong parentName="li">{`75%`}</strong>{`. This can be increased upto 100% to increase the authentication security.  `}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`Edit`}</strong>{` to change the defined `}<strong parentName="li">{`Confidence Level`}</strong>{`.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Confidence Screen1" src={useBaseUrl('img/app-manual/conflevel1.png')} />
      <img alt="Confidence Screen2" src={useBaseUrl('img/app-manual/conflevel2.png')} />
      <img alt="Confidence Screen3" src={useBaseUrl('img/app-manual/conflevel3.png')} />
    </div>
    <ol {...{
      "start": 4
    }}>
      <li parentName="ol">{`If you don't have either voice or face recognition enrolled, on clicking the `}<strong parentName="li">{`Manage confidence level`}</strong>{` option, you will be displayed with a toast message `}<strong parentName="li">{`“Confidence level cannot be managed for fingerprint authentication”`}</strong>{`.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Confidence Screen4" src={useBaseUrl('img/app-manual/conflevel4.png')} />
    </div>
    <h3 {...{
      "id": "manage-my-authentications"
    }}>{`Manage my authentications`}</h3>
    <p>{`You can enroll for multiple biometric options as well as disable/delete any enrolled biometric option. In addition, you can also enroll multiple passphrases for voice recognition so that you would be displayed with any random enrolled passphrase for voice authentication. These features increase the security of the application.`}</p>
    <h4 {...{
      "id": "enroll-to-a-biometric-option"
    }}>{`Enroll to a biometric option`}</h4>
    <ol>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`Manage my authentication`}</strong>{` menu within Settings menu`}</li>
      <li parentName="ol">{`The `}<strong parentName="li">{`enrolled biometric`}</strong>{` options will have a `}<strong parentName="li">{`wedge icon`}</strong>{` next to them whereas `}<strong parentName="li">{`un-enrolled biometric`}</strong>{` options will have an `}<strong parentName="li">{`italicized text displayed`}</strong>{` underneath them `}<strong parentName="li">{`“You are not enrolled !!”`}</strong>{` with an option to `}<strong parentName="li">{`“Enroll”`}</strong>{`.`}</li>
      <li parentName="ol">{`On clicking `}<strong parentName="li">{`“Enroll”`}</strong>{`, you will be shown a `}<strong parentName="li">{`pop-up message`}</strong>{` indicating that the option is currently `}<strong parentName="li">{`un-enrolled`}</strong>{`. Click on the `}<strong parentName="li">{`“Enroll now”`}</strong>{` button on the pop-up to continue the enrollment process.`}</li>
      <li parentName="ol">{`You will now be navigated to the enrollment process similar to that of the registration process.`}</li>
      <li parentName="ol">{`On successful enrollment of the selected biometric option, the enrollment will be reflected in your account and you will now be able to use that biometric option `}<strong parentName="li">{`for any authentication`}</strong>{`.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Manage Bio Screen1" src={useBaseUrl('img/app-manual/managebio1.png')} />
      <img alt="Manage Bio Screen2" src={useBaseUrl('img/app-manual/managebio2.png')} />
    </div>
    <h4 {...{
      "id": "manage-passphrases"
    }}>{`Manage Passphrases`}</h4>
    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M6.3 5.69a.942.942 0 0 1-.28-.7c0-.28.09-.52.28-.7.19-.18.42-.28.7-.28.28 0 .52.09.7.28.18.19.28.42.28.7 0 .28-.09.52-.28.7a1 1 0 0 1-.7.3c-.28 0-.52-.11-.7-.3zM8 7.99c-.02-.25-.11-.48-.31-.69-.2-.19-.42-.3-.69-.31H6c-.27.02-.48.13-.69.31-.2.2-.3.44-.31.69h1v3c.02.27.11.5.31.69.2.2.42.31.69.31h1c.27 0 .48-.11.69-.31.2-.19.3-.42.31-.69H8V7.98v.01zM7 2.3c-3.14 0-5.7 2.54-5.7 5.68 0 3.14 2.56 5.7 5.7 5.7s5.7-2.55 5.7-5.7c0-3.15-2.56-5.69-5.7-5.69v.01zM7 .98c3.86 0 7 3.14 7 7s-3.14 7-7 7-7-3.12-7-7 3.14-7 7-7z"
              }}></path></svg></span>{`note`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Note: This feature can be used only if voice recognition is enabled`}</p></div></div>
    <h5 {...{
      "id": "enroll-additional-passphrase"
    }}>{`Enroll additional passphrase`}</h5>
    <ol>
      <li parentName="ol">{`You can increase the `}<strong parentName="li">{`security`}</strong>{` of your voice authentication by opting to `}<strong parentName="li">{`enroll for multiple passphrases`}</strong>{`.`}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`Manage my authentication`}</strong>{` menu within the Settings menu.`}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`wedge icon next to the Voice authentication option`}</strong>{`.`}</li>
      <li parentName="ol">{`Select the `}<strong parentName="li">{`Manage passphrases`}</strong>{` option.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Passphrase Screen1" src={useBaseUrl('img/app-manual/passphrase1.png')} />
    </div>
    <ol {...{
      "start": 5
    }}>
      <li parentName="ol">{`You will now be displayed with the list of `}<strong parentName="li">{`enrolled passphrases`}</strong>{`.`}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`Add passphrase`}</strong>{` option available on the screen.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Passphrase Screen2" src={useBaseUrl('img/app-manual/passphrase2.png')} />
    </div>
    <ol {...{
      "start": 7
    }}>
      <li parentName="ol">{`A list of `}<strong parentName="li">{`available passphrases`}</strong>{` that you have `}<strong parentName="li">{`not yet enrolled`}</strong>{` with will be shown.`}</li>
      <li parentName="ol"><strong parentName="li">{`Choose`}</strong>{` any one passphrase to enroll.`}</li>
      <li parentName="ol">{`Click the `}<strong parentName="li">{`Continue`}</strong>{` button to continue the enrollment process.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Passphrase Screen3" src={useBaseUrl('img/app-manual/passphrase3.png')} />
    </div>
    <ol {...{
      "start": 10
    }}>
      <li parentName="ol">{`You will now be navigated to the voice recording screen similar to that of the voice registration process. The process of enrollment is `}<strong parentName="li">{`the same`}</strong>{` to that of the voice registration process.`}</li>
      <li parentName="ol">{`Once the additional passphrase is successfully enrolled, your account will be updated with the additional passphrase.`}</li>
      <li parentName="ol">{`During voice authentication, the application would display any `}<strong parentName="li">{`random`}</strong>{` enrolled passphrase.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Passphrase Screen4" src={useBaseUrl('img/app-manual/passphrase4.png')} />
    </div>
    <h3 {...{
      "id": "disable-biometric-recognition"
    }}>{`Disable Biometric Recognition`}</h3>
    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M6.3 5.69a.942.942 0 0 1-.28-.7c0-.28.09-.52.28-.7.19-.18.42-.28.7-.28.28 0 .52.09.7.28.18.19.28.42.28.7 0 .28-.09.52-.28.7a1 1 0 0 1-.7.3c-.28 0-.52-.11-.7-.3zM8 7.99c-.02-.25-.11-.48-.31-.69-.2-.19-.42-.3-.69-.31H6c-.27.02-.48.13-.69.31-.2.2-.3.44-.31.69h1v3c.02.27.11.5.31.69.2.2.42.31.69.31h1c.27 0 .48-.11.69-.31.2-.19.3-.42.31-.69H8V7.98v.01zM7 2.3c-3.14 0-5.7 2.54-5.7 5.68 0 3.14 2.56 5.7 5.7 5.7s5.7-2.55 5.7-5.7c0-3.15-2.56-5.69-5.7-5.69v.01zM7 .98c3.86 0 7 3.14 7 7s-3.14 7-7 7-7-3.12-7-7 3.14-7 7-7z"
              }}></path></svg></span>{`note`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Note: If you have only one biometric option enrolled, you will  not be able to disable that biometric option`}</p></div></div>
    <ol>
      <li parentName="ol">{`You can `}<strong parentName="li">{`disable any biometric option`}</strong>{` temporarily provided you have `}<strong parentName="li">{`another active biometric option`}</strong>{` enabled. `}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`“Manage my authentication”`}</strong>{` menu within the `}<strong parentName="li">{`Settings`}</strong>{` menu`}</li>
      <li parentName="ol">{`The enrolled biometric options have a `}<strong parentName="li">{`wedge`}</strong>{` icon which provides the options to control the settings of the biometric.`}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`“Disable”`}</strong>{` option in the dropdown to disable the biometric option.`}</li>
      <li parentName="ol">{`On clicking the `}<em parentName="li">{`“Disable”`}</em>{` option, you will be shown a pop-up message indicating the data retention. Click on the `}<strong parentName="li">{`“Confirm”`}</strong>{` button on the pop-up to continue the disable process.`}</li>
      <li parentName="ol">{`On confirmation, the biometric option would be `}<strong parentName="li">{`disabled`}</strong>{`.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Disable Bio Screen1" src={useBaseUrl('img/app-manual/disablebio1.png')} />
      <img alt="Disable Bio Screen2" src={useBaseUrl('img/app-manual/disablebio2.png')} />
    </div>
    <h3 {...{
      "id": "enable-biometric-recognition"
    }}>{`Enable biometric recognition`}</h3>
    <ol>
      <li parentName="ol">{`You can `}<strong parentName="li">{`enable`}</strong>{` any biometric option that you may have disabled. `}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`“Manage my authentication”`}</strong>{` within `}<strong parentName="li">{`Settings`}</strong>{` menu`}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`wedge`}</strong>{` icon next to the enrolled biometric option. `}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`“Enable”`}</strong>{` option in the dropdown to enable the biometric option.`}</li>
      <li parentName="ol">{`You will be shown a pop-up message confirming the reactivation of the biometric option. Click on the `}<strong parentName="li">{`“Confirm”`}</strong>{` button to continue the reactivation process.`}</li>
      <li parentName="ol">{`On confirmation, the biometric option would be reactivated and would be available for authentication.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Enable Bio Screen1" src={useBaseUrl('img/app-manual/enablebio1.png')} />
      <img alt="Enable Bio Screen2" src={useBaseUrl('img/app-manual/enablebio2.png')} />
    </div>
    <h3 {...{
      "id": "delete-biometric-recognition"
    }}>{`Delete biometric recognition`}</h3>
    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M6.3 5.69a.942.942 0 0 1-.28-.7c0-.28.09-.52.28-.7.19-.18.42-.28.7-.28.28 0 .52.09.7.28.18.19.28.42.28.7 0 .28-.09.52-.28.7a1 1 0 0 1-.7.3c-.28 0-.52-.11-.7-.3zM8 7.99c-.02-.25-.11-.48-.31-.69-.2-.19-.42-.3-.69-.31H6c-.27.02-.48.13-.69.31-.2.2-.3.44-.31.69h1v3c.02.27.11.5.31.69.2.2.42.31.69.31h1c.27 0 .48-.11.69-.31.2-.19.3-.42.31-.69H8V7.98v.01zM7 2.3c-3.14 0-5.7 2.54-5.7 5.68 0 3.14 2.56 5.7 5.7 5.7s5.7-2.55 5.7-5.7c0-3.15-2.56-5.69-5.7-5.69v.01zM7 .98c3.86 0 7 3.14 7 7s-3.14 7-7 7-7-3.12-7-7 3.14-7 7-7z"
              }}></path></svg></span>{`note`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Note: If you have only one biometric option enrolled, you will  not be able to delete that biometric option`}</p></div></div>
    <ol>
      <li parentName="ol">{`You can `}<strong parentName="li">{`delete`}</strong>{` any biometric option provided you have `}<strong parentName="li">{`another active biometric option`}</strong>{` enabled. `}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`“Manage my authentication”`}</strong>{` menu within `}<strong parentName="li">{`Settings`}</strong>{` menu`}</li>
      <li parentName="ol">{`The enrolled biometric options have a `}<strong parentName="li">{`wedge`}</strong>{` icon which provides the options to control the settings of the biometric.`}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`“Delete”`}</strong>{` option in the dropdown to delete the biometric option.`}</li>
      <li parentName="ol">{`On clicking the `}<strong parentName="li">{`“Delete”`}</strong>{` option, you will be shown a pop-up message indicating that the data would be r`}<strong parentName="li">{`emoved from the system`}</strong>{`. Click on the `}<strong parentName="li">{`“Confirm”`}</strong>{` button on the pop-up to continue the delete process.`}</li>
      <li parentName="ol">{`On confirmation, the biometric option would be deleted.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Delete Bio Screen1" src={useBaseUrl('img/app-manual/deletebio1.png')} />
      <img alt="Delete Bio Screen2" src={useBaseUrl('img/app-manual/deletebio2.png')} />
    </div>
    <h3 {...{
      "id": "deactivate-account"
    }}>{`Deactivate account`}</h3>
    <ol>
      <li parentName="ol">{`You can temporarily `}<strong parentName="li">{`deactivate`}</strong>{` your account.`}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`“Account”`}</strong>{` settings within the `}<strong parentName="li">{`Settings`}</strong>{` menu. `}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`“Deactivate”`}</strong>{` option in the dropdown.`}</li>
      <li parentName="ol">{`You will be shown a pop-up message indicating that the data would be `}<strong parentName="li">{`retained in the system`}</strong>{`. Click on the `}<strong parentName="li">{`“Confirm”`}</strong>{` button on the pop-up to continue the account deactivation process. `}</li>
      <li parentName="ol">{`On successful account deactivation, you will be navigated back to the registration screen`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Deactivate Screen1" src={useBaseUrl('img/app-manual/deactivate1.png')} />
      <img alt="Deactivate Screen2" src={useBaseUrl('img/app-manual/deactivate2.png')} />
    </div>
    <h3 {...{
      "id": "reactivate-account"
    }}>{`Reactivate account`}</h3>
    <ol>
      <li parentName="ol">{`You can `}<strong parentName="li">{`reactivate`}</strong>{` your account if it is temporarily deactivated.`}</li>
      <li parentName="ol">{`Enter your `}<strong parentName="li">{`registered mobile number`}</strong>{`.`}</li>
      <li parentName="ol">{`The application will validate your mobile number.`}</li>
      <li parentName="ol">{`You would be displayed a pop-up message stating that your account is “`}<strong parentName="li">{`Inactive”`}</strong>{` and would you like to activate the same.`}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`Confirm`}</strong>{` button on the pop-up to continue the reactivation process`}</li>
      <li parentName="ol">{`You would be shown your active enrolled biometric options to `}<strong parentName="li">{`validate your account`}</strong>{`.`}</li>
      <li parentName="ol">{`Once authenticated, your account would be activated and you would be navigated to the home screen.`}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Reactivate Screen1" src={useBaseUrl('img/app-manual/reactivate1.png')} />
    </div>
    <h3 {...{
      "id": "delete-account"
    }}>{`Delete account`}</h3>
    <ol>
      <li parentName="ol">{`You can `}<strong parentName="li">{`delete`}</strong>{` your account if you no longer need to use the application and all your biometric options would also be removed.`}</li>
      <li parentName="ol">{`Click on `}<strong parentName="li">{`“Account”`}</strong>{` menu within `}<strong parentName="li">{`Settings`}</strong>{` menu`}</li>
      <li parentName="ol">{`Click on the `}<strong parentName="li">{`“Delete”`}</strong>{` option in the dropdown to delete your account.`}</li>
      <li parentName="ol">{`On clicking the `}<strong parentName="li">{`“Delete”`}</strong>{` option, you will be shown a pop-up message indicating that the data would be removed from the system. Click on the `}<strong parentName="li">{`“Confirm”`}</strong>{` button on the pop-up to continue the account delete process. `}</li>
    </ol>
    <div style={{
      textAlign: 'center'
    }}>
      <img alt="Delete Screen1" src={useBaseUrl('img/app-manual/delete1.png')} />
      <img alt="Delete Screen2" src={useBaseUrl('img/app-manual/delete2.png')} />
    </div>
    <ol {...{
      "start": 5
    }}>
      <li parentName="ol">{`On successful account deletion, you will be navigated back to the registration screen.`}</li>
    </ol>
    </MDXLayout>;
}

